def count_primes(n):
    """
    Given a number n, count the number of prime numbers less than or equal to n.
    A prime number is a number that is divisible only by itself and 1.
    """
    prime_count = 0
    for i in range(2, n):
        if i > 1:
            prime_count += 1
            for j in range(2, i):
                if i % j == 0:
                    break
        else:
            prime_count += 1
    return prime_count
