def nested_loop_ternary_operator(n):
    """
    Write a program that uses nested loops and the ternary operator to solve the following problem:
    Given a 2D array of integers, find the sum of all elements that are either below the main diagonal or above the main diagonal.
    """
    rows = len(n)
    cols = len(n[0])
    sum = 0
    for i in range(rows):
        for j in range(cols):
            if i == j:
                sum += n[i][j]
            else:
                sum += n[i][j] * n[j][i]
    return sum
